import React from "react";


function Work(){
    return(
        <div className="App">
           <h1 className="container">Projects</h1>
           <hr></hr>
           <p class="flex-container">
            <div><a target="_blank" href="https://hayvant.github.io/giphymeetsmovies/">MoviesGiffys</a></div>
            <div><a target="_blank" href="https://fatimafbz.github.io/Weather-dashboard/">Weather Dashboard</a></div>
            <div><a target="_blank" href=" https://fatimafbz.github.io/work_Day_Scheduler/">Day Planner</a></div>
            <div><a target="_blank" href="https://lifetracker-project2.herokuapp.com/">LifeTracker</a></div>
            <div><a target="_blank" href=" https://techblog1a.herokuapp.com/">TechBlog</a></div>
            <div><a target="_blank" href="https://notetaker-fb.herokuapp.com/">NoteTaker</a></div>
        </p>
        </div>
    )
}


export default Work;
